import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Quiz from './Quiz';

const App = () => {
  const BrowserRouter = createBrowserRouter();

  return (
    <BrowserRouter>
      <RouterProvider>
        <div>
          <h1>Welcome to the Quiz App</h1>
          <Link to="/quiz">Take the quiz</Link>
          <Outlet />
        </div>
      </RouterProvider>
    </BrowserRouter>
  );
};

export default App;
